// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

contract Farmers {
    bool public check;

    struct FarmersData{
        string farmerLocation;
        uint farmerid;
        uint premium;
        uint payout;
    }

    mapping(uint => FarmersData) private _farmers;
    uint public totalFarmers;

    function enroll(string memory farmerLocation_,uint premium_) external{    //string will last only till execution of this function and not stored  in blockchain
            _farmers[totalFarmers].farmerLocation=farmerLocation_;
            _farmers[totalFarmers].premium=premium_;
            totalFarmers += 1;
    }

    function payPremium(uint farmerid_) external payable{
        _farmers[farmerid_].premium +=  msg.value;
    }

    function trigger() public  returns (bool){
            check = true;
      
            return check;
    } 

    function claim(uint farmerLocation_ ) external payable{

    }
}

